import React from 'react';

import './thisUserProfile.css';

const thisUserProfile = props => (
  <li className="users__list-item">
    <div>
    <p>Your Profile</p>
      <h1>{props.authUserId}</h1>
      <h1>{props.user.name}</h1>
      <p>
        ${props.userId}
      </p>
      <p>
        ${props.username}
      </p>
      <p>
        ${props.email}
      </p>
      <p>
        ${props.dob}
      </p>
      <p>
        ${props.address}
      </p>
      <p>
        ${props.phone}
      </p>
      <p>
        ${props.socialMedia}
      </p>
    </div>
  </li>
);

export default thisUserProfile;
